import React, { useState } from "react";
import homeImg from "../../home.png";
import profileImg from "../../profile.png";
import writeImg from "../../write.png";
import searchImg from "../../search.png";
import profileimgImg from "../../profileimg.png";
import { Link } from "react-router-dom";

function HomePage() {
  const [cards, setCards] = useState([
    { id: 1, nickname: 'ÎãâÎÑ§ÏûÑ1', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ1', image: profileimgImg },
    { id: 2, nickname: 'ÎãâÎÑ§ÏûÑ2', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ2', image: profileimgImg },
    { id: 3, nickname: 'ÎãâÎÑ§ÏûÑ3', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ3', image: profileimgImg },
    { id: 4, nickname: 'ÎãâÎÑ§ÏûÑ4', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ4', image: profileimgImg },
    { id: 5, nickname: 'ÎãâÎÑ§ÏûÑ5', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ5', image: profileimgImg },
    { id: 6, nickname: 'ÎãâÎÑ§ÏûÑ6', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ6', image: profileimgImg },
    { id: 7, nickname: 'ÎãâÎÑ§ÏûÑ7', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ7', image: profileimgImg },
    { id: 8, nickname: 'ÎãâÎÑ§ÏûÑ8', recipeName: 'ÏöîÎ¶¨ Ïù¥Î¶Ñ8', image: profileimgImg }
  ]);

  const rows = [];
  for (let i = 0; i < cards.length; i += 2) {
    rows.push(cards.slice(i, i + 2));
  }

  return (
    <div className="container2">
      <div className="title-box-home">
        <h1 className="ft-big">ÎÇòÏùò Ï∑®Ìñ•Ï†ÄÍ≤© Î†àÏãúÌîºüî´</h1>
      </div>
      <div className="search">
        <img src={searchImg} className="search-img" />
        <input
          className="search-box"
          type="text"
          placeholder="Î†àÏãúÌîº Í≤ÄÏÉâÌïòÍ∏∞"
        />
      </div>
      <div className="container3">
        {rows.map((row, rowIndex) => (
          <div className="recipe-wrap" key={rowIndex}>
            {row.map(card => (
              <Card 
                key={card.id}
                nickname={card.nickname} 
                recipeName={card.recipeName} 
                image={card.image} 
              />
            ))}
          </div>
        ))}
      </div>
      <nav>
        <Link to={'/home'}>
          <div>
            <img src={homeImg} alt="Ìôà" />
            <p>Ìôà</p>
          </div>
        </Link>
        <Link to={'/my'}>
          <div>
            <img src={profileImg} alt="MY" />
            <p>MY</p>
          </div>
        </Link>
        <Link to={'/write'}>
          <div>
            <img src={writeImg} alt="Í∏ÄÏì∞Í∏∞" />
            <p>Í∏ÄÏì∞Í∏∞</p>
          </div>
        </Link>
      </nav>
    </div>
  );
}

function Card({ nickname, recipeName, image }) {
  return (
    <Link to={'#'} className="recipe-card">
      <div className="recipe">
        <div className="recipe-profile">
          <img src={image} className="profile-img" />
          <p className="ft-recipe">{nickname}</p>
        </div>
        <img src={image} className="recipe-img" />
        <div className="recipe-name">
          <p className="ft-recipe-small">{recipeName}</p>
        </div>
      </div>
    </Link>
  );
}

export default HomePage;
